import React from 'react';
import '../../node_modules/bootstrap/dist/css/bootstrap.min.css';

const App = () =>{
     return (
          <> 
               <div className='container di '>
               <h1 className="text-center mt-5 text-capitalize text-success ">This is Bootstrap__5th</h1>
               <button className='btn btn-success'>The is Button</button>
               </div>
          </>
     )
}
export default App;
